const keys = [
  "SOLEMNITY",
  "SUNDAY",
  "TRIDUUM",
  "HOLY_WEEK",
  "FEAST",
  "MEMORIAL",
  "OPT_MEMORIAL",
  "COMMEMORATION",
  "FERIA"
];

class Types {
  #keys;

  constructor(keys) {
    this.#keys = keys;
    for (let key of keys) {
      this[key] = key;
    }
  }

  keys() {
    return this.#keys;
  }
}

var test = new Types(keys);

console.log(test.SOLEMNITY)
console.log(test.keys())
